var dataTimes=[];
var dataPart=[];
let dataa=[5,6,7,8,9,10];
var result=[];
fetch('https://backend-111406.onrender.com/api/record/user4', {
    method: "GET",
    headers: new Headers({
        'Content-Type': 'application/json',
        'token': `eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9.eyJ1c2VyX2lkIjoiYWRtaW4iLCJfaWQiOiI2MzRhNDg5OTJkNzAyY2EzYWRlNTlmMzYiLCJlbWFpbCI6InpzZGE1ODU4c2RhQGdtYWlsLmNvbSIsInJvbGUiOjkwMCwiZXhwIjoxNjY1OTE0NDY5fQ.yXfkv1Ko4-VfPCv4xC54DFe6Ukui7CEIx7Da71erams`, /* 把token放在這 */
    })
}
)

    .then(results=>{
    dataa=results.data;
    
    dataa.map((a)=>(
        dataTimes.push(a.times)
    ));
    console.log(dataTimes);
    
});

export const data1234={

    labels:"beceps",
    datasets:[
        {
            label: "biceps",
            data: dataTimes,
            fill: true,
            backgroundColor: "rgba(75,192,192,0.2)",
            borderColor: "rgba(75,192,192,1)",
            lineTension: 0.5
        }
    ]
}
